INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (-470.0, "2024/03/15 15:00:00", 1, 10015, "2024/06/22 14:59:59", "いらっしゃいませ～♪\nきゃらばんこいん？を\n交換できるんだってー", 0.0, 0.0, 2002, 2, 2, 4, "ナーナ", 130401);
