INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (-470.0, "2024/06/15 15:00:00", 3, 10019, "2024/09/22 14:59:59", "うﾞぇぇえんっ！まﾞだごの\n格好になっぢゃいまじだ！\n寄付をお願いじまず～っ！", 0.0, 0.0, 2002, 4, 4, 5, "ホウオウ", 130503);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (-470.0, "2024/06/15 15:00:00", 1, 10020, "2024/09/22 14:59:59", "おっすー♪\nなんでも交換してけー\nカリザきゅん以外で", 4.9, 0.0, 2002, 2, 1, 5, "ネア", 123301);
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (-470.0, "2024/06/15 15:00:00", 2, 10021, "2024/09/22 14:59:59", "ところで、騎士きゅんは\nおいくら万ルピ？\nジョーダンぬ・き・で♡", 4.8, 0.0, 2002, 2, 1, 5, "ネア", 123301);
